import React from 'react';
import { BrowserRouter, Rout , Switch } from 'react-router-dom';
import StorePicker from "./StorePicker";

const Router = () => (
    <BrowserRouter>
        <switch>
            <route exact path="/" component={StorePicker} />
        </switch>
    </BrowserRouter>
)

export default Router;
